import React from 'react';
import {
    Box
} from '@mui/material';
import bghero from '../public/hero.jpg'

const heroStyle = {
    border: 'solid 2px black',
    height: '90vh',
    backgroundImage: `url(${bghero})`
}

const Hero = () => {
    return (
        <Box
            sx={heroStyle}
        >

        </Box>
    )
}

export default Hero;
